import React from "react";
import { Container, Row, Col } from "reactstrap";
import ChatList from "./ChatList";
import ChatWindow from "./ChatWindow";
import "./App.css";

const App = () => {
  return (
    <Container>
      <Row>
        <Col xs='12' md='4' className='mb-4'>
          <ChatList />
        </Col>
        <Col xs='12' md='8'>
          <ChatWindow />
        </Col>
      </Row>
    </Container>
  );
};

export default App;
